import React from "react";
import './Navbar.css';


const Navbar = ()=>{
    return (
        <nav>
            <div className="nav_box">
                <span className="my_shop">
                    My Shopping
                </span>
                <div className="cart">
                    <span>
                        <i className="fa fa-cart-plus" />
                    </span>

                </div>
            </div>
            
		
		
        </nav>
    )
}

export default Navbar;
